import '../Styles/Side-menu.css'
const SideMenu = () => {

  return (
        <tr className="menu-box">
            <h3><a href="/dashboard">Dashboard</a> <a href="/pulling">View Pulling Configuration</a></h3>
            <h3></h3>
            <h3><a href="/table">View Table Configuration</a></h3>
            <h3><a href="/model">View Trained Model</a></h3>
            <h3><a href="/user-mode">Switch Normal User Mode</a></h3>
        </tr>
  );
};

export default SideMenu;
